import React from 'react';

function Projects() {
    return (
        <section>
          <h1>{capitalizeFirstLetter(currentCategory.name)}</h1>
          <p>{currentCategory.name}</p>
          <div className="flex-row">
              <img
                src={photo}
                alt="Commercial Example"
                className="img-thumbnail mx-1"
              />
          </div>
        </section>
      );
}
export default Projects;
